function About() {
    return(
        <div>
            <h2>Acerca de nosotros</h2>
            <p>Somos una empresa dedicada a ofrecer soluciones tecnológicas diseñadas para perfeccionar los procesos de tu empresa o negocio mediante nuestro software personalizado, buscando aumentar la productividad. Además, nos especializamos en mejorar tus ventas a través del desarrollo de sitios web personalizados adaptados a tus necesidades específicas.</p>
        </div>
    )

}

export default About;
